INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(1, '{\"ar\": \"من نحن\", \"en\": \"About Us\"}', 'about-us', '{\"ar\": \"<p style=\\\"text-align: right;\\\">يتميز ديكور الفيصل بتصميمه المميز وديكوره الأنيق ونقدم لكم من خلال المجموعة التالية المتميزة والحديثة</p>\\r\\n<p style=\\\"text-align: right;\\\">&nbsp;</p>\\r\\n<h3 style=\\\"text-align: right;\\\"><span style=\\\"text-decoration: underline;\\\"><strong>خدماتنا</strong></span></h3>\\r\\n<ul>\\r\\n<li dir=\\\"rtl\\\" style=\\\"text-align: right;\\\"><strong>العزومات والاولائم</strong></li>\\r\\n<li dir=\\\"rtl\\\" style=\\\"text-align: right;\\\"><strong>تجهيز الافراح</strong></li>\\r\\n<li dir=\\\"rtl\\\" style=\\\"text-align: right;\\\"><strong>حفلات التخرج&nbsp;</strong></li>\\r\\n<li dir=\\\"rtl\\\" style=\\\"text-align: right;\\\"><strong>حفلات الشركات</strong></li>\\r\\n<li dir=\\\"rtl\\\" style=\\\"text-align: right;\\\"><strong>حفلات أعياد الميلاد</strong></li>\\r\\n</ul>\", \"en\": \"<p>Al Faisal\'s &nbsp;d&eacute;cor is distinguished by its distinctive design and elegant d&eacute;cor, and we present to you through the following distinct and modern collection</p>\\r\\n<p>&nbsp;</p>\\r\\n<h3><span style=\\\"text-decoration: underline;\\\"><strong>Our Services</strong></span></h3>\\r\\n<ul>\\r\\n<li>wedding</li>\\r\\n<li>Graduation parties</li>\\r\\n<li>Birthday</li>\\r\\n<li>Dinner parties</li>\\r\\n<li>Banquets</li>\\r\\n<li>Companies parties</li>\\r\\n</ul>\\r\\n<p>&nbsp;</p>\\r\\n<p><img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /><img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /> <img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /></p>\\r\\n<p><!-- pagebreak --></p>\\r\\n<p><img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /> <img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /> &nbsp;<img src=\\\"data:image/jpeg;base64,\\\" width=\\\"300\\\" height=\\\"300\\\" /></p>\"}', '2020-10-04 19:01:05', '2020-10-04 19:27:19');
